script: |
  super -f text -I q1962.spq | sort > q1962.out

inputs:
  - name: q1962.spq
    data: |
      SELECT - + col0 - - - 93 + - col2 + + col0 / - + col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - ( - 46 ) * col0 NOT BETWEEN - + col0 + + - col0 AND NULL;
  - name: tab1

outputs:
  - name: q1962.out
    data: |
